import React from 'react';

class HomePage extends React.Component {
  handleButtonClick = (buttonNumber) => {
    alert("Button " + buttonNumber + " clicked!");
  }

  render() {
    return (
      <div>
        <h1>Welcome to the Homepage</h1>
        <div>
          <button onClick={() => this.handleButtonClick(1)}>Button 1</button>
          <button onClick={() => this.handleButtonClick(2)}>Button 2</button>
          <button onClick={() => this.handleButtonClick(3)}>Button 3</button>
        </div>
      </div>
    );
  }
}

export default HomePage;
